package loops;

public class WAPtoPrintSeries {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		for(double d=1.0;d<=10.0;d=d+1) {
			System.out.println(d);
		}
		System.out.println("==============");
		for(int i=0;i<=100;i=i+9) {
			System.out.println(i);
		}
	}

}
